<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8">
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>2024 Scouting App</title>
</head>

<body>
  <p id="fullscreenBTN">&#x26F6;</p>

  <p id="switchBTN" onclick="openSwitchDialog()">&equiv;</p>
  <dialog class="switchDialog" id="switchDialog">
    <button onclick="switchDialogMatch()" class="switchDialogMatch">Match</button>
    <button onclick="switchDialogPit()" class="switchDialogPit">Pit</button>
    <button onclick="switchDialogSuper()" class="switchDialogSuper">Super</button>
  </dialog>

  <p class="mainTitle">Scout App</p>
  
  <div class="container" id="matchScout">
    <div class="input-form">

      <p class="preMatchTitle">Pre-Match</p>

      <label>Scouter Name</label>
      <input type="text" class="scouterNameField" placeholder="Scouter Name">

      <label>Match Number</label>
      <input type="number" inputmode="numeric" class="matchNumberField" placeholder="Match Number" >

      <label>Team Number</label>
      <input type="number" inputmode="numeric" class="teamNumberField" placeholder="Team Number">

      <!--No Show hides certain elements if team does not show up to a match-->
      <label for="noShow">No Show</label>
      <input type="checkbox" id="noShow" class="noShow">
      <div id="noShowToggle">

      <div class="radio">
        <p class="radioTitle">Start Position</p>
        <div class="radioInput">
          <label class="radioLabel">1</label>
          <input type="radio" name="startPosition" value="1"/>
          <label class="radioLabel">2</label>
          <input type="radio" name="startPosition" value="2"/>
          <label class="radioLabel">3</label>
          <input type="radio" name="startPosition" value="3"/>
          <label class="radioLabel">4</label>
          <input type="radio" name="startPosition" value="4"/>
        </div>
        <button class="startPositionLabel" onclick="showStartPositionMap()">Map</button>
        <dialog id="startPositionDialog">
                <button class="rotateStartPositionMap" onclick="rotateStartPositionMap()">&#8635;</button>
                <button class="closeStartPositionMap" onclick="closeStartPositionMap()">X</button>

  <script defer>
    
    //Create variables for each input
    var container = document.querySelector(".container");
    var generateBtn = document.querySelector(".generate-btn");
    var scouterName = document.querySelector(".scouterNameField");
    var matchNumberField = document.querySelector(".matchNumberField");
    var teamNumberField = document.querySelector(".teamNumberField");
    var noShow = document.querySelector(".noShow");
    let startPosition = document.querySelectorAll('input[name="startPosition"]');
    var preLoadScored = document.querySelector(".preLoadScored");
    var leftStartZone = document.querySelector(".leftStartZone");
    var shootPosition1 = document.querySelector(".shootPosition1");
    var shootPosition2 = document.querySelector(".shootPosition2");
    var shootPosition3 = document.querySelector(".shootPosition3");
    var shootPosition4 = document.querySelector(".shootPosition4");
    var trapSide1 = document.querySelector(".trapSide1");
    var trapSide2 = document.querySelector(".trapSide2");
    var trapSide3 = document.querySelector(".trapSide3");
    var onStage = document.querySelectorAll('input[name="onStage"]')
    var parked = document.querySelector(".parked");
    var robotDeath = document.querySelector(".robotDeath");
    var commentField = document.querySelector(".commentField");

    let qr_code_counter = 0;
    generateBtn.onclick = function() {
      if (qr_code_counter == 0) {
        if (scouterName.value.length > 0) {
          qr_code_counter++;

          // Checks for unanswered radio questions and replaces it with a blank string for easier reading later on
          if (startPosition != "1" && startPosition != "2" && startPosition != "3" && startPosition != "4") {
            startPosition = "";
          }
          if (onStage != "Climbed" && onStage != "Failed" && onStage != "Not Tried") {
            onStage = "";
          }

          generateBtn.innerText = "Generating QR Code...";
          //The spacer automatically puts each input into seperate columns when exporting to Google Sheets
          let spacer = "	";
          // Creates a variable to hold all the data collected
          let data = scouterName.value + spacer + matchNumberField.value + spacer + teamNumberField.value + spacer + noShow.checked + spacer + startPosition + spacer + preLoadScored.checked + spacer + leftStartZone.checked + spacer + autoAMP + spacer + autoSpeaker + spacer + teleAMP + spacer + teleSpeaker + spacer + shootPosition1.checked + spacer + shootPosition2.checked + spacer + shootPosition3.checked + spacer + shootPosition4.checked + spacer + trapSide1.checked + spacer + trapSide2.checked + spacer + trapSide3.checked + spacer + onStage + spacer + parked.checked + spacer + robotDeath.checked + spacer + commentField.value + "\n";

          // fixes bug in QR Library where the code may not work right between these number of characters
          if (data.length > 192 && data.length < 220) {
                data += spacer + "                               ";     
          }

          //Creates the QR-Code
            var qrcode = new QRCode(document.getElementById("qrcode"), {
              text: data,
              width: 300,
              height: 300,
              colorDark: "#000000",
              colorLight: "#ffffff",
              correctLevel: QRCode.CorrectLevel.L
            });;
       
          //Outputs the data into the console for easy viewing
          console.log(data);

          //reveals the QR-Code
          container.classList.add("active");
          generateBtn.innerText = "Generated";
          
        } else {
          generateBtn.innerText = "Missing Scout Name!";
          setInterval(generateBtnReset, 2000);
          function generateBtnReset() {
            generateBtn.innerText = "Generate";
          }
        }
      } else {
        generateBtn.innerText = "Only one QR Code";
        setInterval(generateBtnAmount, 2000);
          function generateBtnAmount() {
            generateBtn.innerText = "Generate";
      }
    }
  }

        teleAMPNumberStepperNumber = document.querySelector(".teleAMPnumberStepperNumber");

        teleAMP = (teleAMP < 10) ? "" + teleAMP : teleAMP;

            teleAMP = (teleAMP < 10) ? "" + teleAMP : teleAMP;
            teleAMPNumberStepperNumber.innerText = teleAMP;

        teleSpeakerNumberStepperNumber = document.querySelector(".teleSpeakernumberStepperNumber");
    let teleSpeaker = 0;

        teleSpeaker++;
        teleSpeaker = (teleSpeaker < 10) ? "" + teleSpeaker : teleSpeaker;
        teleSpeakerNumberStepperNumber.innerText = teleSpeaker;
    });

    teleSpeakerNumberStepperMinus.addEventListener("click", () => {
        if (teleSpeaker > 0) {
            teleSpeaker--;
            teleSpeaker = (teleSpeaker < 10) ? "" + teleSpeaker : teleSpeaker;

    var startPositionDialog = document.getElementById("startPositionDialog");
    var startPositionMap = document.getElementById("startPositionMap");
    function showStartPositionMap() {
        startPositionDialog.show();
    }
    function closeStartPositionMap() {
        startPositionDialog.close();
    }

    var startPostionCounter = 0;
    function rotateStartPositionMap() {
        if (startPostionCounter == 0) {
            startPositionMap.src = "./img/field.png";
            startPostionCounter = 1;
        } else {
            startPositionMap.src = "./img/startPositions.png";
            startPostionCounter = 0;
        }
    }

    function resetMatch() {
        location.reload();
        return false;
    }

    // Fullscreen Toggle
    var fullscreenBTN = document.getElementById("fullscreenBTN")
    fullscreenBTN.addEventListener("click", () => {

        if (!document.fullscreenElement) {
            document.documentElement.requestFullscreen();
        } else if (document.exitFullscreen) {
            document.exitFullscreen();
        }
    });

    var switchDialog = document.getElementById("switchDialog");
    var matchScout = document.getElementById("matchScout");
    var pitScout = document.getElementById("pitScout");
    var superScout = document.getElementById("superScout");
    function openSwitchDialog() {
        switchDialog.show();
    }
    function closeSwitchDialog() {
        switchDialog.close();
    }
    function switchDialogMatch() {
        matchScout.style.display = "block";
        pitScout.style.display = "none";
        superScout.style.display = "none";
        switchDialog.close();
    }
    function switchDialogPit() {
        matchScout.style.display = "none";
        pitScout.style.display = "block";
        superScout.style.display = "none";
        switchDialog.close();

        matchScout.style.display = "none";
        pitScout.style.display = "none";
        superScout.style.display = "block";
        switchDialog.close();
